import React from 'react'
import  { useState, useEffect } from 'react';
import axios from 'axios';
import { makeStyles } from '@material-ui/core/styles';
import Divider from '@material-ui/core/Divider';
import Paper from '@material-ui/core/Paper';



class ReactHome extends React.Component {

  constructor(props){
    super(props)
    this.state={
      content:[]
    }
    fetch('/api/react/getLessons')
    .then(res=>res.json())
    .then(response=>this.setState({content:response}))
  }



render(){
  let tutorialName = this.state.content.filter(function(topic){
    return topic.tutorial_name='React-Home'
  })

  return (

    <div>
    {console.log(tutorialName)}
    <br/><br/><br/>
      <Paper >
      {this.state.content.map(item=>(
        <div key={item._id}>
        {item.name}
        {item.lesson_description}
        </div>
      ))}
      </Paper>
    </div>
  )
}
}

export default ReactHome
